import * as types from "../../config/type"

export const setEmail = (data = "") => ({type: types.LOGIN_USERNAME, data})
export const setPassword = (data = "") => ({type: types.LOGIN_PASSWORD, data})
export const setUsername = (data = "") => ({type: types.LOGIN_USERNAME, data})
export const setCounter = (data = []) => ({type: types.LOGIN_COUNTER, data})
